import React from 'react'
import '../Login.css';
import { Link } from 'react-router-dom';
import { useFormInputValidation } from "react-form-input-validation";
import jQuery from 'jquery';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'jquery/dist/jquery.min.js';
//Datatable Modules
import "datatables.net-dt/js/dataTables.dataTables"
import "datatables.net-dt/css/jquery.dataTables.min.css"
import "datatables.net-buttons/js/dataTables.buttons.js"
import "datatables.net-buttons/js/buttons.colVis.js"
import "datatables.net-buttons/js/buttons.flash.js"
import "datatables.net-buttons/js/buttons.html5.js"
import "datatables.net-buttons/js/buttons.print.js"
import "datatables.net-dt/css/jquery.dataTables.min.css"
export default function SelfLogin() {

    const [fields, errors, form] = useFormInputValidation({
        mobile_number: "",
        password: "",
    }, {
        mobile_number: "required|number",
        password: "required"
    });
    
      // useEffect(() => {
      //   if (form.isValidForm) {
      //     // console.log(fields, errors, form);
      //     // Perform api call here
      //     alert('f');
      //   }
      // }, [])
    const onSubmit = async (event) => {
        const isValid = await form.validate(event);
        if (isValid) {
          // console.log(fields, errors);
          // Perform api call here
        }
    }

    $(document).ready(function () {
        setTimeout(function(){
        $('#example').DataTable(
            {
                retrieve: true,
                pagingType: 'full_numbers',
                pageLength: 10,
                processing: true,
                dom: 'Bfrtip',
                    buttons: ['copy', 'csv', 'print'
                ]
            }
        );
        } ,
        1000
        );
    });

  return (
    <div>
       <div className="Auth-form-container">
            <form className="Auth-form myForm" method="post" noValidate autoComplete="off"  onSubmit={onSubmit}>
                <div className="Auth-form-content">
                <h3 className="Auth-form-title">Two Factor Authentication</h3>
                <div className="form-group mt-3">
                    <label>Mobile Number <span className='span'>*</span></label>
                    <input
                        type="email"
                        className="form-control mt-1"
                        placeholder="Enter Mobile Number"
                        name="mobile_number"
                        onBlur={form.handleBlurEvent}
                        onChange={form.handleChangeEvent}
                        value={fields.mobile_number}
                        
                    />
                    <label className="error">
                    {errors.mobile_number  ? errors.mobile_number : ""}
                    </label>
                </div>
                <div className="form-group mt-3">
                    <label>Password</label>
                    <input
                    type="date"
                    className="form-control mt-1"
                    placeholder="Enter password"
                    name="password"
                    onBlur={form.handleBlurEvent}
                    onChange={form.handleChangeEvent}
                    value={fields.password}
                    />
                    <label className="error">
                    {errors.password ? errors.password : ""}
                    </label>
                </div>  
                <div className="d-grid gap-2 mt-3">
                    <button type="submit" className="btn btn-primary">
                    Submit
                    </button>
                </div>
                <p className="forgot-password text-right mt-2">
                <Link to='../ForgetPassword'>Forgot password?</Link>
                </p>
                </div>
            </form>
        </div>
    </div>
  )
}
